	public void calculateAxis(float[] transform, float[] z_axis) {
		z_axis = Vector.normalize(z_axis);
		float[] result = MatrixOp.multiplyMV(transform, new float[]{0, 1, 0, 0});
		result = Vector.normalize(result);
		axis = Vector.cross(result, z_axis);
	}
	
	
	@Override
	public void updateKinematics() {
		time ++;
		this.applyRot(.08f, axis);
		//this.transList.set(0, new Transformation(-.08f*time+position.x, position.y, position.z));
		//this.transList.set(4,  new Transformation(.05f*time));
		
	}
	

